import styled from 'styled-components'

export const AddButtonDiv = styled.div`
    display:flex;
    justify-content:center;
    padding-bottom:20px;
`

export const Button = styled.button`
    border-radius:25px;
    padding: 5px 10px;
    font-family: Monsterrat, sans-serif;
    background: #d3dbd3;
    border:none;
    font-size:18px;
`
